#define PIC_SCALAR ("")
#define PIC_VECTOR ("")
#define PIC_TENSOR ("")
#define PIC_TENSOR4 ("")
#define PIC_COMPLEX_DOUBLE ("")
#define PIC_COMPLEX_FLOAT ("")
#define PIC_DOUBLE ("")
#define PIC_FLOAT ("")
#define PIC_CONST ("")
#define PIC_NOT_CONST ("")
