  HTMLTree::HTMLTree() :
    _file(), _name(), _head()
  {
  }

  HTMLTree::HTMLTree(const std::string &name, const std::string &path) :
    _file(), _name(name), _head(), _peakMemory()
  {
    open(name, path);
  }

  HTMLTree::~HTMLTree()
  {
    close();
  }

  bool HTMLTree::open(const std::string &name, const std::string &path)
  {
    close();
    _name = name;
    std::string fileName = path;
    if(path != "") {
      if(path.back() != '/') {
        fileName += '/';
      }
    }
    fileName += name + ".html";
    _file.open(fileName, std::fstream::out);

    return true;
  }

  bool HTMLTree::isOpen() const
  {
    return _file.is_open();
  }

  void HTMLTree::close()
  {
    if(_file.is_open()) {
      _file.close();
    }
  }

  static void _writeNode(std::ofstream &file, const HTMLNode *node)
  {
    std::string degree = "<img src=\"data:image/png;base64,";
    if(node->degree == Degree::Degree0) {
      degree += PIC_SCALAR;
    }
    else if(node->degree == Degree::Degree1) {
      degree += PIC_VECTOR;
    }
    else if(node->degree == Degree::Degree2) {
      degree += PIC_TENSOR;
    }
    else if(node->degree == Degree::Degree4) {
      degree += PIC_TENSOR4;
    }
    degree += "\" height=\"16pt\" width=\"16pt\" />";

    std::string scalar = "<img src=\"data:image/png;base64,";
    if(node->scalar == scalar::Name< std::complex< double > >::name) {
      scalar += PIC_COMPLEX_DOUBLE;
    }
    else if(node->scalar == scalar::Name< std::complex< float > >::name) {
      scalar += PIC_COMPLEX_FLOAT;
    }
    else if(node->scalar == scalar::Name< double >::name) {
      scalar += PIC_DOUBLE;
    }
    else if(node->scalar == scalar::Name< float >::name) {
      scalar += PIC_FLOAT;
    }
    scalar += "\" height=\"16pt\" width=\"16pt\" />";

    file << "<li> <span class=\"" << (node->leaves.size() ? "node" : "endnode") << "\"> <a href=\"#\" > <span class=\"tags\">";
    file << "<span class=\"tag\"> " << degree << "</span> ";
    file << "<span class=\"tag\"> " << scalar << "</span> ";
    file << "<span class=\"tag\"> <img src=\"data:image/png;base64," << (node->constant ? PIC_CONST : PIC_NOT_CONST) << "\" height=\"16pt\" width=\"16pt\" /></span> ";
    if(node->nodeType == function::NodeType::Binary || node->nodeType == function::NodeType::Unary) {
      file << "<span class=\"tag\"> <img src=\"data:image/png;base64," << (node->swappable ? PIC_SWAP : PIC_NOT_SWAP) << "\" height=\"16pt\" width=\"16pt\" /></span> ";
    }
    file << "</span>" << node->name;
    if(node->leaves.size()) {
      file << "<span class=\"memories\"> <span class=\"memory\">" << node->localMemory.memory() << "</span> </span>";
    }
    file << "</a> </span>" << std::endl;
    file << "<ol class=\"nested\">" << std::endl;
    for(unsigned int i = 0; i < node->leaves.size(); ++i) {
      _writeNode(file, &(node->leaves[i]));
    }
    file << "</ol>" << std::endl;
    file << "</li>" << std::endl;
  }

