  void HTMLTree::write()
  {
    _file << "<!DOCTYPE html>" << std::endl;

    _file << "<head>" << std::endl;
    _writeHeader(_file);
    _file << "</head>" << std::endl;

    _file << "<body>" << std::endl;
    _file << "<div id=\"main\">" << std::endl;
    _file << "<p class=\"date\"> " << today() << ", " << hour() << " </p>" << std::endl;
    _file << "<div class=\"header\">" << std::endl;
    _file << "<a href=\"https://gitlab.onelab.info/gmsh/fem.git\">" << std::endl;
    _file << "<img src=\"data:image/png;base64," << PIC_GMSHFEM << "\" />" << std::endl;
    _file << "</a>" << std::endl;
    _file << "<h1> GmshFEM function tree viewer </h1>" << std::endl;
    _file << "</div>" << std::endl;
    _file << "<h2> Tree of function \"" << _name << "\" </h2>\n"
          << std::endl;

    _file << "<p class=\"peakMemory\"> Peak memory by points: " << _peakMemory.memory() << " </p>" << std::endl;

    _file << "<ol>" << std::endl;
    _writeNode(_file, &_head);
    _file << "</ol>" << std::endl;

    _file << "<script>" << std::endl;
    _file << "var toggler = document.getElementsByClassName(\"node\");" << std::endl;
    _file << "var i;" << std::endl;
    _file << "for (i = 0; i < toggler.length; i++) {" << std::endl;
    _file << "toggler[i].addEventListener(\"click\", function() {" << std::endl;
    _file << "this.parentElement.querySelector(\".nested\").classList.toggle(\"active\");" << std::endl;
    _file << "this.classList.toggle(\"node-down\");" << std::endl;
    _file << "});" << std::endl;
    _file << "}" << std::endl;
    _file << "</script>" << std::endl;
    _file << "</div>" << std::endl;
    _file << "<footer>" << std::endl;
    _file << "<span class=\"copyright\">" << std::endl;
    _file << "GmshFEM - Copyright (C) 2019-2022, A. Royer, E. B&eacute;chet, C. Geuzaine, Universit&eacute; de Li&egrave;ge" << std::endl;
    _file << "</span>" << std::endl;
    _file << "<span class=\"version\">" << std::endl;
    _file << "version " << std::to_string(GMSHFEM_MAJOR_VERSION) + "." + std::to_string(GMSHFEM_MINOR_VERSION) + "." + std::to_string(GMSHFEM_PATCH_VERSION) << std::endl;
    _file << "</span>" << std::endl;
    _file << "</footer>" << std::endl;

    _file << "</body>" << std::endl;
  }

